import os
import sys
import numpy as np
from collections import defaultdict

def cal_avg(makespans,exp):
    m = np.mean(list(makespans.values()))
    print('Num of output file at home : %d' %(len(makespans)))
    print('Avg makespan per image: %s' %(exp))
    print(m)

def cal_comm(comm, exp):

    from_task_list = set()
    to_task_list = set()
    for key,value in comm.items():
        from_task_list.add(key[1])
        to_task_list.add(key[2])

    from_task_list = list(from_task_list)
    to_task_list = list(to_task_list)
    # from_task_list = ['data','master','resnet0','resnet1','resnet2','resnet3','resnet4','resnet5','resnet6','resnet7','resnet8','collage',
    # 'store','lccenc','score','preagg','lccdec']
    # to_task_list = ['master','resnet0','resnet1','resnet2','resnet3','resnet4','resnet5','resnet6','resnet7','resnet8','collage',
    # 'store','lccenc','score','preagg','lccdec','home']



    comm_time = defaultdict(lambda: 0)
    comm_count = defaultdict(lambda: 0)
    comm_avg = defaultdict(lambda: 0)
    for key, value in comm.items():
        for ft in from_task_list:
            for tt in to_task_list:
                # if key[1].startswith(ft) and key[2].startswith(tt):
                if key[1]==ft and key[2]==tt:
                    comm_time[(key[1],key[2])] = comm_time[(key[1],key[2])]+value
                    comm_count[(key[1],key[2])] = comm_count[(key[1],key[2])]+1

    for key, value in comm_time.items():
        comm_avg[key] = comm_time[key] / comm_count[key]

    print('Avg communication time: %s' %(exp))
    print(comm_avg)

def cal_exec(execd, exp):

    task_list = set()
    for key,value in execd.items():
        task_list.add(key[0])

    task_list = list(task_list)
    exec_time = defaultdict(lambda: 0)
    exec_count = defaultdict(lambda: 0)
    exec_avg = defaultdict(lambda: 0)
    wait_time = defaultdict(lambda: 0)
    wait_avg = defaultdict(lambda: 0)
    real_exec_time = defaultdict(lambda: 0)
    real_exec_avg = defaultdict(lambda: 0)
    prewait_time = defaultdict(lambda: 0)
    prewait_avg = defaultdict(lambda: 0)
    postwait_time = defaultdict(lambda: 0)
    postwait_avg = defaultdict(lambda: 0)

    # 'Enter_time','Execute_time','Finish_time','Elapse_time','Duration_time','Waiting_time', 'Real execution time', 'Prewaiting','Postwaiting'

    for key, value in execd.items():
        for t in task_list:
            if key[0]==t:
                exec_time[key[0]] = exec_time[key[0]]+float(value[4])
                exec_count[key[0]] = exec_count[key[0]]+1
                wait_time[key[0]] = wait_time[key[0]]+float(value[5])
                real_exec_time[key[0]] = exec_time[key[0]]+float(value[6])
                prewait_time[key[0]] = prewait_time[key[0]]+float(value[7])
                postwait_time[key[0]] = postwait_time[key[0]]+float(value[8])


    for key, value in exec_time.items():
        exec_avg[key] = exec_time[key] / exec_count[key]
        wait_avg[key] = wait_time[key] / exec_count[key]
        real_exec_avg[key] = real_exec_time[key] / exec_count[key]
        prewait_avg[key] = prewait_time[key] / exec_count[key]
        postwait_avg[key] = postwait_time[key] / exec_count[key]


    print('Avg execution time: %s' %(exp))
    print(exec_avg)
    print('Avg waiting time: %s' %(exp))
    print(wait_avg)
    print('Avg real execution time: %s' %(exp))
    print(real_exec_avg)
    print('Avg pre waiting time: %s' %(exp))
    print(prewait_avg)
    print('Avg post waiting time: %s' %(exp))
    print(postwait_avg)



